import React, { Component, Fragment} from 'react';
import { BrowserRouter as Router,Switch } from 'react-router-dom';
import Navbar from './Navbar' 

import QuestionsList from './QuestionsList';
class Home extends Component {
    render() { 
        return (
           <Router>
                <Navbar/>
                <Switch>
                    <QuestionsList/>
                </Switch>
           </Router>
        );
    }
}
 
export default Home;
